import React, { useState } from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import HomePage from './components/pages/LandingPage';
import Login from './components/Auth/Login';
import SubscriptionPage from './components/SubscriptionPage'; // Importer la page d'abonnement
import Workout from './components/pages/Workout'; // Importer la page Workout

const App: React.FC = () => {
  const [bodyType, setBodyType] = useState<'ectomorph' | 'mesomorph' | 'endomorph'>('ectomorph'); // État pour gérer bodyType

  return (
    <Router>
      <Routes>
        <Route path="/" element={<HomePage setBodyType={setBodyType} />} /> {/* Passer setBodyType si nécessaire */}
        <Route path="/login" element={<Login />} />
        <Route path="/subscription" element={<SubscriptionPage />} />
        <Route path="/workout" element={<Workout bodyType={bodyType} />} /> {/* Passer bodyType ici */}
        {/* Autres routes */}
      </Routes>
    </Router>
  );
};

export default App;
